// imports react
import React from 'react';
// imports profile picture
import joey from '../assets/images/joey.jpg'
// aboutme function
function AboutMe() {
  const styles = {

  };
  // returns html for aboutme state
  return (
    <div className='d-flex flex-column align-items-center pb-5'>
      <h2>About Me</h2>
      <a href='https://github.com/hvansalisbury'>
        <img src={joey} alt="Joey Douek" height="200" width="200" className="border border-5 border-secondary image-link"></img>
      </a> 
      <p className='w-50 m-2 fs-2'>
    Developing skills with computers and sound. I enjoy coding and producing music.
    Sound with computers fascinates me to learn more about it. I am a fan of early chip wave sound. 
    Retro art and games are a passion of mine too. I like learning about them and how they are made! 

      </p>
    </div>
  );
};
// exports aboutme function
export default AboutMe;
